e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"57475","type":"Paragraph"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"57208","type":"BoxAnnotation"},{"attributes":{"ticks":[1582675200000.0,1583280000000.0,1583884800000.0,1584489600000.0,1585094400000.0,1585699200000.0,1586304000000.0,1586908800000.0,1587513600000.0,1588118400000.0,1588723200000.0,1589328000000.0,1589932800000.0,1590537600000.0,1591142400000.0,1591747200000.0]},"id":"57221","type":"FixedTicker"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"57217","type":"Line"},{"attributes":{"source":{"id":"57216"}},"id":"57220","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":2},"x":{"field":"x"},"y":{"field":"y"}},"id":"57225","type":"Circle"},{"attributes":{"text":"&lt;select onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"BiASiliaioi.html\"&gt;Municipio: Salvador&lt;/option&gt;&lt;option value=\"BiAFiiiaidiaitini.html\"&gt;Municipio: Feira de Santana&lt;/option&gt;&lt;option value=\"BiAVitiriaidioiqiiiti.html\"&gt;Municipio: Vit\u00f3ria da Conquista&lt;/option&gt;&lt;option value=\"BiAIiaiuiai.html\"&gt;Municipio: Itabuna&lt;/option&gt;&lt;option value=\"BiAJiaieiri.html\"&gt;Municipio: Juazeiro&lt;/option&gt;&lt;option value=\"SiEAiaiaiui.html\"&gt;Municipio: Aracaju&lt;/option&gt;&lt;option value=\"SiEIiaiaiaiai.html\"&gt;Munici
